script: |
  super -f tsv -I q3357.sql | sort > q3357.out

inputs:
  - name: q3357.sql
    data: |
      SELECT 65 + - col0 FROM tab2 WHERE 1 + col2 NOT BETWEEN ( - + NULLIF ( + NULLIF ( - col2, - col0 ), - 63 ) + + 62 ) AND NULL GROUP BY col0;
  - name: tab2

outputs:
  - name: q3357.out
    data: |
      -26
      -27
      50
